import React, { Component } from 'react';
import CovidCarrierStatus from './covid-carrier-status';
import CovidCarrierNumber from './covid-carrier-number';
import CovidPatientData from './covid-patient-data';
import CovidNewsList from './covid-news';

class App extends Component {
  render() {
    return (
      <div className="container-fluid p-5">
        <div className="container">
          <div className="row">
            <div className="col-12 col-md-3 test">
              aaaaa
            </div>
            <div className="col-12 col-md-9 my-3">
              <div className="d-flex flex-wrap">
                <div className="w-100 mh-450px of-y-scrl p-3">
                  <CovidNewsList />
                </div>
                <div className="w-100 p-3">
                  <CovidCarrierNumber />
                </div>
                <div className="w-55 p-3">
                  <CovidPatientData />
                </div>
                <div className="w-45 p-3">
                  <CovidCarrierStatus />
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
